import React from "react";

const styleObj={
    columnProperty:"10px",
    width: "10px",
}



const TrendItem = (props) => {
    return (
        <>
            <tr>
                <th  className="titemStyle"  style={styleObj} scope="row" >{props.tid}</th>
                <td className="titemStyle" style={styleObj}>{props.hashtagi}</td>
                <td className="titemStyle"  style={styleObj}><button class="btn btn-outline-success zsbtn zstbtn" type="submit">Sentiment</button></td>
            </tr>
        </>

    );
}

export {TrendItem};
